import { Link } from "react-router-dom"

interface SingleItineraryCellProps {
    itinerary: any
}

export const SingleItineraryCell = ({itinerary}: SingleItineraryCellProps) => {
    return (
        <button>
            <Link to="/itineraries/">{itinerary.name}</Link>
        </button>
    )
}
